import './App.css';

const fName = 'Michal';
const lName = 'Fingert';
const randomNumber = Math.floor(Math.random() * 10);
function App() {
  return (
    <div className="App">
      <h1>
        Hello {fName} {lName}!
      </h1>
      <p>Your lucky number is {randomNumber} </p>
    </div>
  );
}

export default App;
